    INSERT INTO HISTORIAL_FICHA (ID_ficha, ID_sede, ID_torre, Salon, ID_almacen, ID_equipo, Descripcion, ID_marca, ID_modelo, Numero_serie, Codigo_isil, Imagen, ID_usuario, ID_operatividad, Observaciones, Fecha_registro, Tipo_movimiento)
    VALUES (NEW.ID_ficha, NEW.ID_sede, NEW.ID_torre, NEW.Salon, NEW.ID_almacen, NEW.ID_equipo, NEW.Descripcion, NEW.ID_marca, NEW.ID_modelo, NEW.Numero_serie, NEW.Codigo_isil, NEW.Imagen, NEW.ID_usuario, NEW.ID_operatividad, NEW.Observaciones, NOW(), 'Inserción');
END
$$
