DELIMITER $$
CREATE TRIGGER `after_ficha_update` AFTER UPDATE ON `ficha` FOR EACH ROW BEGIN
    DECLARE movimiento VARCHAR(20);
    IF NEW.Est = 1 THEN
        SET movimiento = 'Edición';
    ELSEIF NEW.Est = 2 THEN
        SET movimiento = 'Eliminado';
    END IF;
    INSERT INTO HISTORIAL_FICHA (ID_ficha, ID_sede, ID_torre, Salon, ID_almacen, ID_equipo, Descripcion, ID_marca, ID_modelo, Numero_serie, Codigo_isil, Imagen, ID_usuario, ID_usuario_modificador, ID_operatividad, Observaciones, Fecha_registro, Tipo_movimiento)
